import React, { Component } from "react";

class Navbar extends Component {
  render() {
    return (
      <div class="navbar">
          <span> Logo </span>
          <button> Register </button>
          <button> Login </button>
      </div>
    );
  }
}

Navbar.propTypes = {};

export default Navbar;
